changeGroupSize = function(key, letter) {
  if (key === 'I' && settings[letter] > 1) {
    settings[letter]--;
  }
  if (key === 'K') {
    if (letter === 'B') {
      echo(settings.B, tableCount(), settings.B < tableCount());
      if (settings.B < tableCount()) {
        settings[letter]++;
      }
    } else {
      settings[letter]++;
    }
  }
  if (key === 'I' || key === 'K') {
    if (letter === 'A') {
      showPlayers();
    }
    if (letter === 'B') {
      showTables();
    }
    if (letter === 'C') {
      return showNames();
    }
  }
};

